import song1 from './Music/LazyDay.mp3';
import song2 from './Music/LoveSong.mp3';

export default [
    ["Live & Love", "Sara J.", song2],
    ["Lazy Song", "Lim", song1],
    ["Cash It", "Jones Jill"],
    ["Bad Days", "Ultra Nova"],
    ["Rest Of Our life", "Yagi"],
    ["That Friend.", "Laura T."],
    ["Great Mess", "Hank Pops"],
];
